import React from "react";
import { Menu } from "semantic-ui-react";
import { NavLink } from "react-router-dom";

export default function Navbar() {
  return (
    <Menu stackable fixed="top">
      <Menu.Item header>Kenyatta's Profile</Menu.Item>
      <Menu.Item as={NavLink} to="/About" name="About" exact>
        <Menu.Item as={NavLink} to="/Profile" name="Profile" exact />
        <Menu.Item as={NavLink} to="/Contacts" name="Contacts" exact>Contact</Menu.Item>
      </Menu.Item>
    </Menu>
  );
}
